import React, {memo} from 'react';
import styled from 'styled-components';
import dataset from '../../dataset';

const PalksStoryContainer = styled.div`
    display: flex;

    .storyWrap{
        width:50%;
        height:300px;

        .storyInner{
            display: block;
            width:100%;
            height:100%;

            .textWrap{
                margin:60px 80px;

                .title{
                    width:400px;
                    font-size:46px;
                    font-family: 'Montserrat', sans-serif;
                    font-weight: 900;
                }

                p{
                    margin-top:20px;
                    font-size:18px;
                    font-family: 'Noto Sans KR', sans-serif;
                    font-weight: 600;
                }

                .moreBtn{
                    display: flex;
                    justify-content: center;
                    align-items: center;
                    margin-top:20px;
                    width:50px;
                    height:50px;
                    background-color: #fff;
                    border-radius: 50%;
                    box-shadow: 3px 3px 10px #00000020;
                }
            }
        }
    }

`;

const PalksStory = memo(() => {
